Explanation:

The system is meant to remove all unnecessary ingredients, formatting and formulas and standardize the information, otherwise be unintelligible. Sometimes however the output does not correctly split the info. For example, levement will recognize it as an ingredient and factor it out while still being a formula. This will result in the the original instruction still remaining. Thus formulization was added to this system to act as a second line of defense and factor out ingredients that the first system missed, hopefully without affecting the readability.

Create a copy of the system first, add secondMode and then modify the instructions so it resembles line 1.

The most important part that affect the readability negatively are the different variables. To tackle these six are introduced:
- I If the info is correct, Intact;
- Y If yogurts are mentiond;
- E If eggs are mentiond;
- S If sugar is mentiond;
- H If honey is mentiond;
- K If yeast is mentioned.

These variables are factorized out to the end of the end of the string if they are mentioned. In the end of the list they have the number five, meaning the length of the original list. Continue reading ‘Clarify Ingredient List’

